schema:
{
 "description": "UserProfile is the Schema for the UserProfiles API",
 "properties": {
  "spec": {
   "description": "UserProfileSpec defines the desired state of UserProfile.",
   "properties": {
    "domainID": {
     "description": "The ID of the associated Domain.",
     "type": "string"
    },
    "singleSignOnUserIdentifier": {
     "description": "A specifier for the type of value specified in SingleSignOnUserValue. Currently,\nthe only supported value is \"UserName\". If the Domain's AuthMode is IAM Identity\nCenter, this field is required. If the Domain's AuthMode is not IAM Identity\nCenter, this field cannot be specified.",
     "type": "string"
    },
    "singleSignOnUserValue": {
     "description": "The username of the associated Amazon Web Services Single Sign-On User for\nthis UserProfile. If the Domain's AuthMode is IAM Identity Center, this field\nis required, and must match a valid username of a user in your directory.\nIf the Domain's AuthMode is not IAM Identity Center, this field cannot be\nspecified.",
     "type": "string"
    },
    "tags": {
     "description": "Each tag consists of a key and an optional value. Tag keys must be unique\nper resource.\n\n\nTags that you specify for the User Profile are also added to all Apps that\nthe User Profile launches.",
     "items": {
      "description": "A tag object that consists of a key and an optional value, used to manage\nmetadata for SageMaker Amazon Web Services resources.\n\n\nYou can add tags to notebook instances, training jobs, hyperparameter tuning\njobs, batch transform jobs, models, labeling jobs, work teams, endpoint configurations,\nand endpoints. For more information on adding tags to SageMaker resources,\nsee AddTags.\n\n\nFor more information on adding metadata to your Amazon Web Services resources\nwith tagging, see Tagging Amazon Web Services resources (https://docs.aws.amazon.com/general/latest/gr/aws_tagging.html).\nFor advice on best practices for managing Amazon Web Services resources with\ntagging, see Tagging Best Practices: Implement an Effective Amazon Web Services\nResource Tagging Strategy (https://d1.awsstatic.com/whitepapers/aws-tagging-best-practices.pdf).",
      "properties": {
       "key": {
        "type": "string"
       },
       "value": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "userProfileName": {
     "description": "A name for the UserProfile. This value is not case sensitive.",
     "type": "string"
    },
    "userSettings": {
     "description": "A collection of settings.",
     "properties": {
      "executionRole": {
       "type": "string"
      },
      "jupyterServerAppSettings": {
       "description": "The JupyterServer app settings.",
       "properties": {
        "defaultResourceSpec": {
         "description": "Specifies the ARN's of a SageMaker image and SageMaker image version, and\nthe instance type that the version runs on.",
         "properties": {
          "instanceType": {
           "type": "string"
          },
          "lifecycleConfigARN": {
           "type": "string"
          },
          "sageMakerImageARN": {
           "type": "string"
          },
          "sageMakerImageVersionARN": {
           "type": "string"
          }
         },
         "type": "object"
        },
        "lifecycleConfigARNs": {
         "items": {
          "type": "string"
         },
         "type": "array"
        }
       },
       "type": "object"
      },
      "kernelGatewayAppSettings": {
       "description": "The KernelGateway app settings.",
       "properties": {
        "customImages": {
         "items": {
          "description": "A custom SageMaker image. For more information, see Bring your own SageMaker\nimage (https://docs.aws.amazon.com/sagemaker/latest/dg/studio-byoi.html).",
          "properties": {
           "appImageConfigName": {
            "type": "string"
           },
           "imageName": {
            "type": "string"
           },
           "imageVersionNumber": {
            "format": "int64",
            "type": "integer"
           }
          },
          "type": "object"
         },
         "type": "array"
        },
        "defaultResourceSpec": {
         "description": "Specifies the ARN's of a SageMaker image and SageMaker image version, and\nthe instance type that the version runs on.",
         "properties": {
          "instanceType": {
           "type": "string"
          },
          "lifecycleConfigARN": {
           "type": "string"
          },
          "sageMakerImageARN": {
           "type": "string"
          },
          "sageMakerImageVersionARN": {
           "type": "string"
          }
         },
         "type": "object"
        },
        "lifecycleConfigARNs": {
         "items": {
          "type": "string"
         },
         "type": "array"
        }
       },
       "type": "object"
      },
      "rStudioServerProAppSettings": {
       "description": "A collection of settings that configure user interaction with the RStudioServerPro\napp. RStudioServerProAppSettings cannot be updated. The RStudioServerPro\napp must be deleted and a new one created to make any changes.",
       "properties": {
        "accessStatus": {
         "type": "string"
        },
        "userGroup": {
         "type": "string"
        }
       },
       "type": "object"
      },
      "securityGroups": {
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "sharingSettings": {
       "description": "Specifies options for sharing SageMaker Studio notebooks. These settings\nare specified as part of DefaultUserSettings when the CreateDomain API is\ncalled, and as part of UserSettings when the CreateUserProfile API is called.\nWhen SharingSettings is not specified, notebook sharing isn't allowed.",
       "properties": {
        "notebookOutputOption": {
         "type": "string"
        },
        "s3KMSKeyID": {
         "type": "string"
        },
        "s3OutputPath": {
         "type": "string"
        }
       },
       "type": "object"
      },
      "tensorBoardAppSettings": {
       "description": "The TensorBoard app settings.",
       "properties": {
        "defaultResourceSpec": {
         "description": "Specifies the ARN's of a SageMaker image and SageMaker image version, and\nthe instance type that the version runs on.",
         "properties": {
          "instanceType": {
           "type": "string"
          },
          "lifecycleConfigARN": {
           "type": "string"
          },
          "sageMakerImageARN": {
           "type": "string"
          },
          "sageMakerImageVersionARN": {
           "type": "string"
          }
         },
         "type": "object"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    }
   },
   "required": [
    "domainID",
    "userProfileName"
   ],
   "type": "object"
  }
 },
 "title": "User Profile",
 "type": "object"
}
